export default function App() {
    const result = [
      {
        name: "shanu",
        label: ["ak", "pk", "plk", "k"],
        value: [1, 2, 3, 5]
      }
    ];
  
    return result.map((el) => {
      return (
        <div>
          <div className="header">{el.name}</div>
          <div className="grid-container">
            {el.label.map((e, index) => {
              return (
                <div
                  className="grid-item"
                  style={{ textAlign: index % 2 === 0 ? "left" : "right" }}
                >
                  {e} : {el.value[index]}
                </div>
              );
            })}
          </div>
        </div>
      );
    });
  }
